    public static Session setGmailProperties(){
        if(SendMail.prop==null){
            prop = new Properties();
            prop.put("mail.smtp.host", "smtp.gmail.com");
            prop.put("mail.smtp.ssl.trust", "smtp.gmail.com");
            prop.put("mail.smtp.port", "587");
            prop.put("mail.smtp.auth", "true");
            prop.put("mail.smtp.starttls.enable", "true");
        }
        if(SendMail.session==null) {
            session = Session.getInstance(prop,
                    new javax.mail.Authenticator() {
                        protected PasswordAuthentication getPasswordAuthentication() {
                            return new PasswordAuthentication(USERNAME, PASSWORD);
                        }
                    });
        }
        return SendMail.session;
    }

    public static Message getMessage(Session session,String messageToSent,String toMailId) throws MessagingException {
        Message message = new MimeMessage(session);
        try {
            message.setFrom(new InternetAddress("hitesh0766@gmail.com"));
            message.setRecipients(
                    Message.RecipientType.TO,
                    InternetAddress.parse(toMailId)
            );
            message.setSubject("Testing Gmail TLS");
            message.setContent(
                    messageToSent,
                    "text/html");
        }catch(Exception e){
            throw e;
        }
        return message;
    }

    public static void sendMessage(Message message) throws MessagingException {
        try{
            Transport.send(message);
            System.out.println("Message Send Sucessfully");
        }catch(Exception e){
            throw e;
        }
    }


